import React, { Component } from 'react'
import {RoomContext} from "../context"

export default class FeaturedRooms extends Component {
    static contextType = RoomContext;
    render() {
        const value = this.context;
        console.log(value)

        const valueArray = Object.keys(value);
        console.log(valueArray);

        return (
            <div className="featured-rooms-centered">
              {Object.keys(value).map((item, key) => (
                  <div className="featured-rooms"key={key}><img src={value[item].fields.images[0].fields.url}/>{value[item].fields.name}</div>
              ) )}
            </div>
        )
    }
}
